INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "春咲 ひより", 0, 0, 0, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "草野 優衣", 0, 0, 0, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 2, 1002, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "士条 怜", 0, 0, 0, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 2, 1003, "フェンシングを始めてみては？", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "穂高 みそぎ", 0, 0, 0, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 2, 1004, "ねぇ、にいちゃん！", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "風宮 あかり", 0, 0, 0, "ねぇ…", "私といっしょに…\nいかない？", 2, 1006, "風宮あかりです", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "出雲 宮子", 0, 0, 0, "プリンたべたいのー", "食べ物の恨みは怖いのー", 2, 1007, "出雲宮子なのー", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "虹村 雪", 0, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 2, 1008, "ボクは虹村雪。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "柊杏奈", 0, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 2, 1009, "フッ…聞いて後悔するがいい！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "姫宮 真歩", 0, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 2, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "衣之咲 璃乃", 0, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 2, 1011, "衣之咲璃乃です！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "柏崎 初音", 0, 0, 0, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 2, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "美波 鈴奈", 0, 0, 0, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 2, 1016, "ちょす！\n美波鈴奈だよ～♪", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "喜屋武 香織", 0, 0, 0, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 2, 1017, "はいたーい。\n喜屋武香織さー。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "支倉 伊緒", 0, 0, 0, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 2, 1018, "支倉伊緒です。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "茜 ミミ", 0, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 2, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "栗林 くるみ", 0, 0, 0, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 2, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "風宮 より", 0, 0, 0, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 2, 1022, "風宮よりです。\nあああああ！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "北条 綾音", 0, 0, 0, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 2, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "天野 すずめ", 0, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 2, 1025, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "倉石 恵理子", 0, 0, 0, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 2, 1027, "……クスクス…私は\n…倉石恵理子……", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "佐々木 咲恋", 0, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 2, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "桜井 望", 0, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 2, 1029, "桜井望だよ！\nよろしくねっ", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "ニノン・ジュベール", 0, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 2, 1030, "デケデケデンっ！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "上喜 しのぶ", 0, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 2, 1031, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "野戸まひる", 0, 0, 0, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 2, 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "綾瀬 ゆかり", 0, 0, 0, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 2, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "氷川 鏡華", 0, 0, 0, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 2, 1036, "氷川鏡華…です", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "柏崎 栞", 0, 0, 0, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 2, 1038, "柏崎…栞です。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "双葉 碧", 0, 0, 0, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 2, 1040, "ふ、双葉碧です。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "三角 千歌", 0, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 2, 1042, "三角千歌です。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "安芸 真琴", 0, 0, 0, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 2, 1043, "安芸真琴だ。", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "イリヤ・オーンスタイン", 0, 0, 0, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 2, 1044, "わらわこそは夜を総べる者！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "遠見 空花", 0, 0, 0, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 2, 1045, "そこで騎士は妖精を乱暴に……", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "宮坂たまき", 0, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 2, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "大神 美冬", 0, 0, 0, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 2, 1048, "大神美冬よ！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "星野静流", 0, 0, 0, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 2, 1049, "星野静流だよ！", 1.4, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "玉泉美咲", 0, 0, 0, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 2, 1050, "アタシは玉泉美咲。", 1.5, 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "リマ", 0, 0, 0, "？？？？", "？？？？", 2, 1052, "？？？", 1.4, 1);
