INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, 0, 1, 0, "コッコロ", 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 2, 1059, "モニカ・ヴァイスヴィントだ。", 1.5, 1);
